import React from "react";
import { Table } from "reactstrap";
import "../styles/BookTable.css";

export default function BookTable(props) {
  return (
    <div>
      <Table hover id="book-table">
        <thead>
          <tr>
            <th>Read</th>
            <th>Title</th>
            <th>Author</th>
            <th>Rating</th>
          </tr>
        </thead>
        <tbody>
          {props.books.map((book) => {
            return (
              <tr>
                <td className="isread" scope="row" value={book.isread}>
                  <input className="tickbox" type="checkbox" />
                </td>
                <td>
                  <input
                    className="table-editable title"
                    type="text"
                    value={book.title}
                    disabled={true}
                  />
                </td>
                <td>
                  <input
                    className="table-editable author"
                    type="text"
                    value={book.author}
                    disabled={true}
                  />
                </td>
                <td>
                  <input
                    className="table-editable rating"
                    type="text"
                    value={book.rating}
                    disabled={true}
                  />
                </td>
              </tr>
            );
          })}
        </tbody>
      </Table>
    </div>
  );
}
